"title": "SALE - PDF e-Pattern Sea Creature Appliques Sewing Pattern",
"description": "***For a limited time, if you spend $20 or more in our shop, you will receive $5 off your total purchase. In order to receive this discount you must enter the code SPENDTWENTY at checkout.***\r\n\r\nThis is a PDF e-pattern - This is not a finished item. As soon as we receive payment, you will receive a confirmation email from Etsy with information on how to download the e-pattern.\r\n\r\nThese sea creature appliqués are fun and easy to make.  You will receive patterns and instructions to make six creatures – a sea turtle, seahorse, octopus, shark, fish and crab (sea turtle is not pictured here).  There are also four other sea designs that you can use to create little vignettes – seaweed, starfish, bubbles and coral.  We have appliquéd the designs on 12 1/2” fabric squares to give you ideas for placement of the pieces if you want to make a quilt or you can create your own underwater scenes, combining different elements.  You can appliqué the designs on t-shirts, jackets, tote bags, jeans, etc.\r\n\r\nThe appliqué designs come in one size but they can easily be reduced or enlarged to any size that you would like.  \r\n\r\nThe sizes of the sea creature are as follows:\r\nSea Turtle - 7 1/2&quot; x 7 1/2&quot;\r\nSeahorse - 5&quot; x 10&quot;\r\nCrab - 7 3/4&quot; x 9 1/2&quot;\r\nOctopus - 7 1/2&quot; x 8 1/4&quot;\r\nShark - 4&quot; x 9 1/2&quot;\r\nFish - 7 1/2&quot; x 9 1/4&quot;\r\n\r\nButtons are sewn on for the eyes on the sample creatures.  Other options would be to appliqué and sew black and white circles for the eyes, or embroider the eyes, if you don’t want to use the buttons.  It is not recommended to sew button eyes on appliqués for children under the age of three.  \r\n\r\nInstructions are given to machine stitch around the appliqué designs to finish the edges.  Another option would be to embroider the blanket stitch around the edges of the appliqué pieces.\r\n\r\nThe appliqués can be made for girls and boys.  The edges of the appliqué pieces may fray slightly when washed which will add to the charm of the designs.\r\n\r\nTHIS PDF E-PATTERN INCLUDES:\r\n•\tFull size patterns\r\n•\tMaterials list\r\n•\tDetailed instructions written in English\r\n•\tClear step-by-step color photographs\r\n\r\nPlease see our Shop Policies for selling finished items made from our patterns.",
