"title": "Horse Silhouette Vinyl Sticker - personalized Car Decal",
"description": "Horse Silhouette Vinyl Sticker - personalized Car Decal\r\n\r\nThis Horse silhouette has a heart cut out as well as a custom name cut out.  Be sure to specify during check out, in the &quot;notes to seller&quot; section, what name you want and spell it very carefully, I will cut the sticker with the exact name you provide.\r\n\r\nCHOOSE one of the silhouettes from the second or third photo. Be sure to specify during check out which letter silhouette you would like (i.s. A, B, etc...) . I will default to the sticker in the original listing photo if you do not specify...\r\n\r\nThe decal averages 5.75&quot; by 5.50&quot; tall but could be wider or shorter depending on the silhouette choice, and is cut from white vinyl, rated for 5 years use.\r\n\r\nWhat a different breed of horse?  No problem!  I have MANY different silhouettes to choose from, just convo me and I&#39;ll send you additional samples!\r\n\r\nCustom colors and sizes available!  Convo me for details!\r\n\r\nHorse Silhouette Vinyl Sticker - personalized Car Decal\r\n\r\n--------------------------------------------------------------------------------------------------\r\n\r\nIMPORTANT NOTE:  PLEASE do not allow your sticker to sit in the sun or be in the heat prior to putting it on your window.  The top layer of transfer tape will buckle and the sticker will not be able to be salvaged if it is allowed to be in the heat prior to it being applied to your window...leave it in a cool, dry place until you are ready to apply it to your window.  Once on your window, and the top transfer tape is taken off, the actual vinyl is perfectly fine in the sun for years...\r\n\r\n*** Can you flip the dog silhouette to face the other direction? ***\r\nYES!  Just let me know in the &quot;notes to seller&quot; section at check out that you would like it facing left/right and I&#39;ll take care of it.\r\n\r\n*** What can I put it on? ***\r\nVinyl stickers can be put on a variety of surfaces:\r\nCar windows, Motorcycles, Scooters, Skateboards\r\nLaptops, Tablets, iPads, Nooks, Kindles\r\nMixer stands, washing machines, sewing machine covers\r\nShower doors, bath tubs, mirrors, tile\r\nInstrument cases, drum heads, toolboxes\r\nAny flat surface that you want to decorate!  Just be sure to clean it well and allow it to dry before applying your sticker.\r\n\r\n*** How do I apply it? ***\r\nAll orders come with complete instructions, as well as a practice sticker and I’m happy to answer any questions that you have about applying your sticker.\r\n\r\n*** Colors ***\r\nSticker comes in color shown, but you can request custom colors at check out. No extra charge for custom color if I already have it in stock! Keep in mind that lighter colors show up best on the darker tinted car windows…\r\n\r\n*** Custom vinyl? ***\r\nIf you are interested in a custom vinyl sticker, please contact me through my store front under “Request custom item”. I can modify something that is already in my store, or create something entirely new and exciting from your own ideas. I love doing custom work, and have enjoyed the great feedback from happy clients!  Art charges for custom work range from $5-$25 depending on the amount of computer time required.\r\n\r\n*** Important Note ***\r\nThese vinyl stickers are removable but NOT reusable...one time only use, but easily removed when you’re ready for a new look.",
