"user_id": 6530744,
"creation_tsz": 1248031401,
"title": "Custom vinyl stickers for your car and home!",
"announcement": "Specializing in custom vinyl artwork for your car, or laptop or any place else you can think to put it.  If you don&#39;t find what you&#39;re looking for, let me know and I&#39;ll do what I can to make it happen!\r\n\r\nVinyl stickers, Dog stickers, vinyl decals, window stickers, window decals, custom vinyl stickers, personalized dog stickers, dog silhouettes\r\n\r\nProduction time varies (sometimes I can send out orders next day, and other times, orders take a week to two weeks before they are mailed out).  This is all dependent on the volume of orders I have coming in during the year.  If you&#39;d like to check ahead of time to see what current production times are looking like, send me a message and I&#39;ll get back to you quickly to let you know. \r\n\r\nPlease be aware, my shop is closed down on Sundays, that is my day of rest.  If you send me a convo late Saturday or at any time on Sunday, I will not be able to reply until Monday.  Thank you!",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": "My machine is out being serviced...I will be happy to fill your orders just as soon as I get my KNK Groove cutter back up and running!",
"sale_message": "Thank you for shopping with me on Etsy.  Items will ship out in the order they are received.  Current order date to ship date time is 2 weeks!  Please rest assured that the same attention to detail that I&#39;m giving the orders ahead of yours, will be given to your order as well.  And I am doing all that I can to get your order processed just as quickly as possible.\r\n\r\nIf you have any questions regarding your purchase, please let me know.  Your satisfaction is important to me.",
"digital_sale_message": null,
"last_updated_tsz": 1412693043,
"listing_active_count": 220,
"login_name": "blakdogs",
"accepts_custom_requests": true,
"policy_welcome": "Thank you for shopping with me here on Etsy.  I am a small hobby business, doing this on the side while still working full time in the Non-profit sector.  I enjoy working with vinyl and so many friends and family members have enjoyed the &quot;presents&quot; I&#39;ve handed out that I thought I&#39;d share with others who might enjoy and appreciate the handmade, custom quality items I have to offer.",
"policy_payment": "Paypal accepted.  Payment required before orders will be shipped.  Orders may only be canceled BEFORE being shipped out.\r\n\r\n(Please no eCheck orders through PayPal...takes WAY too long to clear!)",
"policy_shipping": "In most cases USPS will be the chosen shipping method.  Delivery confirmation can be added to your items being shipped for an additional charge, convo me for details.  Multiple items can be combined for shipping savings.  Please contact me separately for information on combined shipping.  Items are shipped as economically as possible.  Local pick up is available.",
"policy_refunds": "Refunds or exchanges are done on a case by case basis.  Custom orders cannot be refunded.",
"policy_additional": "IMPORTANT NOTE:  PLEASE do not allow your sticker to sit in the sun or be in the heat prior to putting it on your window.  The top layer of transfer tape will buckle and the sticker will not be able to be salvaged if it is allowed to be in the heat prior to it being applied to your window...leave it in a cool, dry place until you are ready to apply it to your window.  Once on your window, and the top transfer tape is taken off, the actual vinyl is perfectly fine in the sun for years...\r\n\r\n*** Can you flip the dog silhouette to face the other direction? ***\r\nYES!  Just let me know in the &quot;notes to seller&quot; section at check out that you would like it facing left/right and I&#39;ll take care of it.\r\n\r\n*** What can I put it on? ***\r\nVinyl stickers can be put on a variety of surfaces:\r\nCar windows, Motorcycles, Scooters, Skateboards\r\nLaptops, Tablets, iPads, Nooks, Kindles\r\nMixer stands, washing machines, sewing machine covers\r\nShower doors, bath tubs, mirrors, tile\r\nInstrument cases, drum heads, toolboxes\r\nAny flat surface that you want to decorate!  Just be sure to clean it well and allow it to dry before applying your sticker.\r\n\r\n*** How do I apply it? ***\r\nAll orders come with complete instructions, as well as a practice sticker and I’m happy to answer any questions that you have about applying your sticker.\r\n\r\n*** Colors ***\r\nSticker comes in color shown, but you can request custom colors at check out. No extra charge for custom color if I already have it in stock! Keep in mind that lighter colors show up best on the darker tinted car windows…\r\n\r\n*** Custom vinyl? ***\r\nIf you are interested in a custom vinyl sticker, please contact me through my store front under “Request custom item”. I can modify something that is already in my store, or create something entirely new and exciting from your own ideas. I love doing custom work, and have enjoyed the great feedback from happy clients!  Art charges for custom work range from $5-$25 depending on the amount of computer time required.\r\n\r\n*** Important Note ***\r\nThese vinyl stickers are removable but NOT reusable...one time only use, but easily removed when you’re ready for a new look.",
"policy_seller_info": null,
"policy_updated_tsz": 1373147312,
