"description": "Easy and Fun! This needle felting kit includes a pattern hand drawn on a pure wool felt 5 inches square. The kit includes instructions and more than enough hand dyed unspun wool from our sheep to complete the project. Leftover wool can be used to apply a design on a felted item (vest, hat, mittens or hand bag).\r\n\r\nThe finished Thyme Tile will make a lovely pocket for a knitted bag, wall hanging to frame (frame is not included), a coaster or a mug rug. \r\n\r\nNeedle felting tools are not included in this kit, but are available at our Etsy store. \r\n\r\nThe process of needle felting is easy and fun for people of all ages. Children ages 9 and up can be very good at it, and may want to create their own designs. Younger children can have fun, however need adult supervision and assistance.  \r\n\r\nFor more information go to our website www.awrinkleinthymefarm.com",
