"title": "FiberThyme",
"announcement": "Incredibly soft home grown Maine fiber for knitters, spinners, weavers and felt artists. \r\n\r\nOur growing flock includes Ben, a purebred Romney ram, Bilbo Baggins, a three-quarter Finnsheep, Border Leicester cross ewes, and Romney cross lambs that are growing wonderful fiber for you. We invite you to visit our farm when you are in the area (just call ahead), and to see what is happening here visit our web site at www.awrinkleinthymefarm.com.\r\n\r\nOur farm is named A Wrinkle in Thyme Farm using the concept of tesseract (time travel) from the book by Madeline L&#39;Engle. At A Wrinkle in Thyme Farm we like to do things the old fashioned way when we can. For example, we use a draft horse for collecting sap for maple syrup, we sometimes dye wool with plants from the farm, and we hand spin for pleasure and family gifts.\r\n\r\n We feature farmspun (not handspun) yarns, made with fiber from our own animals. We shear the animals, wash and dye and sometimes card the fiber.  Our yarn is either 100% wool and 50/50 mohair blend.   We also have 20% angora from local Maine rabbits blended with 80% of our own Finnsheep wool. Each 150 yard skein of yarn is tagged with an image of the animal that grew it. In summer we dye wool using plants from the farm to create soft colors. We also use acid dyes for a rainbow of brighter and pastel colors.\r\n\r\nWe offer Fiber CSA shares, Thyme Tile patterns for needle felting, pocket bags, and pocket bag kits. Workshops at the farm include dyeing with plants, felting landscapes, and fun dyeing techniques using acid dyes.\r\n\r\n\r\n",
