"title": "Hip Flask in Brass with Horse Racing scene in Enamel Raised Oval on front.",
"description": "There is some confusion over this tiny flask, the Auctioneer thought it was a hip flask for spirits, another said it was a perfume flask.  True, we have never seen a brass hip flask before, but the inside of the screw lid has a cork liner, which a perfume flask would not have.  We like to think that the tapered shape and size of this flask would fit into the pocket of a hacking or Hunting Pink jacket.  The painting on the oval relief is beautiful, a real horse racing find!  This diminutive sized flask is smooth and in good condition with no dents, it is of good age, there is a small area of wear on the lid (as shown in photo).  A really super find.  A rough estimate at the auction was early 20th century (1910-30) but no amount of investigation has given us any further details on an exact date.",
