"announcement": "At CoopsRetroBar we are passionate about Breweriana.  We try to source as many interesting, diverse and collectable items from English Inns, Pubs, bars and taverns as we can, frequenting Auctions is our hobby!  We also have bits from Europe and the USA in our collection.\r\n\r\n  We have our own home bar, we choose our bar for parties, get-togethers and family occasions.  Don&#39;t get us wrong, we still frequent our local pub, its a vital part of the community, but we now have an additional local, right next door, and its cheaper on taxi       fares.  \r\n\r\nOur bar has a 70&#39;s theme, so what began as sourcing unusual vintage items, became a complete passion, which we wanted to share, so CoopsRetroBar was born.  From Auctions, salerooms, Antique Shops and garage and boot sales, we have gathered together all the items you need to stock your own home bar, or to add to your Breweriana collection.\r\n\r\nVintage items can have alternative uses, an ashtray can be used for somewhere to keep your earrings, or as a soap dish. A whisky water jug makes a great milk cream or gravy jug.   Our own gravy boat here at home is a Jamesons water jug, a great table addition. Its fun and quirky to have these items around the house. \r\n\r\nA comprehensive catalogue of goodies, our shop is filled with iconic names from the alcohol and tobacco industries, some, sadly no longer with us. All our items have had a previous life, most of them have lived in pubs, bars and clubs.  Their condition will reflect use, but we will always point out faults and defects using photos and descriptions.  That said, the quality of our stock is first rate, with only a handful having any real problems and we offer those only because they are iconic and true retro items, the cost will be reduced acordingly.   Please be assured of our aim to provide high quality items to you at all times. \r\n\r\n\r\nHave lots of fun incorporating these great vintage items into your bar and home, and enjoy wallowing in your mis-spent youth as much as we do. Welcome - It&#39;s Opening Time - Wendy and Nigel Cooper.\r\n",
