"title": "WhimsyWoo Woooie Pattern NO HORN (PDF)",
"description": "Woooie Pattern ONLY, horn not included in this pattern.\r\nMy very dearest treasure that I have loved and cherished for many years can now be yours too. Create a Woooie (Hobby Horse) of your very own. This PDF pattern allows you to sell the finished products under this agreement: \r\n\r\nSTOP THE HORSES!!!! Check this out!  \r\n\r\nTo compliment your Woooie you can now get 5 different digital embroidery patterns for the eyes!!! If you do not have an embroidery machine you can take your file to an embroidery company and have them make them for you. All you have to do then is sew them on or use heat and bond ultra!!!! Eyes Available (original eye, Eye with Star, Eye with Heart, Boy Eye with Lashers and Girl Eye with Lashers!) please follow this link to purchase the eyes. Please understand under Copy Right Laws we reserve the right to restrict the eyes to PERSONAL USE ONLY and they are not to be sold as a set or individually to others.\r\n \r\n(Iron-On Ready made eyes available: email for enquiries whimsywoo@bigpond.com)\r\n\r\n* All items made using this pattern can be sold, however on tags, signage and internet listings you will need to credit WhimsyWoo, with a link to this store or Facebook page, for the creation of the pattern you used. If you modify the pattern, credit is still due with reference to where you originally started, this is simply to ensure I can continue to sell my very precious treasure and enable others to enjoy it and have fun with it too. All images, concepts and templates in this pattern remain the property of WhimsyWoo under copyright and must not be sold, shared or copied or reproduced in any form.\r\n\r\nIf you can agree to be a good moral person and want to make a Woooie of your very own...Add to cart!!!!!\r\n\r\nPlease note: the embroidery eye files are sold separately and are not included in this pattern. AND last image of Woooies with woollen manes are examples from a customer and instructions for a wool mane is NOT included.\r\n\r\nI have created a group on facebook devoted to this pattern and its makers. Please join for helpful hints, tips and inspiration from others who have made the pattern already. https://www.facebook.com/groups/whimsywoo\r\n\r\nI have added a few video tutorials to YouTube also. https://www.youtube.com/channel/UCY3SCRlZvIliOcUv7_z1FLg",
