"announcement": "Botanical Bird is handmade vintage inspired jewelry, nature jewelry, vintage lockets, acorn necklaces, cameos, steampunk, nautical, custom bridal. Gift box included with each order.  \r\n\r\nYou will also find lovely earrings, bracelets and rings, including romantic Victorian styles, old Hollywood jewels, steampunk necklaces, bird & bee jewelry, hair bobby pins and more.  \r\n\r\n♥ Complimentary gift cards available. If you are purchasing a gift, I will include a small enclosure card with your personal greeting, along with your order, please be sure to write your card&#39;s message details on the invoice during checkout.\r\n\r\n♥ Special discount for Bridal and Bulk orders. I love to create custom bridal party jewelry, and will work closely to get the perfect look for your special day!\r\n\r\n♥ Wholesale pricing for boutiques also available, please message me for details.\r\n\r\n♥ Packages are shipped within 3 business days from the time purchased, all packages are shipped via USPS, first class mail, unless otherwise arranged.\r\n\r\n♥ Join me on Pinterest: http://pinterest.com/botanicalbird/\r\n\r\n♥ BECOME A FAN ON FACEBOOK, find out about Sales, Coupons and more\r\nhttps://www.facebook.com/BotanicalBird\r\n\r\n♥ All  shipping, delivery and payment info can be found in my store policies: www.etsy.com/shop/botanicalbird/policy\r\n\r\n© Botanical Bird 2008-2013, please no duplication of jewelry designs, pictures or descriptions without written permission.\r\n\r\nWholesale:\r\nMy jewelry is sold at a variety of boutiques both locally and internationally, if you would like wholesale info please send me a message here by clicking on the &quot;envelope icon&quot; or the &quot;Contact&quot; button.\r\n\r\n \r\n \r\n ",
