"sale_message": "Thank you for your purchase - If you have recently made a purchase but are unable to wait until I return from Vacation on Oct 5th, please contact me here, and we can arrange a refund, no problem.\r\n\r\nYour business is very much appreciated. In most cases your order will be shipped within 3 business days, except during holiday times and or vacation times.\r\n \r\nAll orders are always shipped to the address you have provided here on the etsy invoice.\r\n \r\nPLEASE DO NOT SEND EMAIL MESSAGES TO: portlandgirl101@aol.com\r\nYOU MAY CONTACT ME AT: bellaflora99@aol.com, or send a message through this etsy store.",
