"policy_payment": "Payment accepted:\r\nPaypal \r\nAll Major credit cards\r\n \r\n\r\nPLEASE SEND ALL CORRESPONDENCE TO bellaflora99@aol.com, \r\nPLEASE DO NOT SEND TO portlandgilr101@aol.com\r\n\r\n \r\n \r\n\r\n ",
